        buckets.append([])
    for i in range(0, len(array)):
        buckets[int((array[i] - minValue) / bucketSize)].append(array[i])
    array = []
    for i in range(0, len(buckets)):
        insertionSort(buckets[i])
        for j in range(0, len(buckets[i])):
